"use strict";
class hewan3 {
    constructor(name, kaki) {
        this.name = name;
        this.kaki = kaki;
    }
}
const hewan4 = new hewan3("Gajah", 12);
console.log(hewan4);
hewan4.name = "jerapah";
hewan4.kaki = 4;
console.log(hewan4);
hewan4.name = "dimas";
hewan4.kaki = 100;
console.log(hewan4);
